/**
 * Node-RED function to track unique MAC addresses and count occurrences.
 * Stores MAC addresses in a single flow array and maintains a counter.
 * Returns msg with mac_counter and newdevice properties.
 * 
 * @param {Object} msg - Node-RED message object with payload.addr (MAC address)
 * @returns {Object} msg - Updated message with mac_counter and newdevice
 */

// Configuration
const MAX_MAC_ADDRESSES = 128; // Prevent unbounded growth

// Normalize MAC address (e.g., lowercase for consistent comparison)
const newMAC = msg.payload.addr;
const type = msg.payload.sensor_type;
// Initialize flow storage for MAC addresses and counter
let macAddresses = flow.get('mac_addresses_114') || [];
let count = flow.get('mac_count_114') || 0;

// Check if MAC address already exists
const existingEntry = macAddresses.find(entry => entry.mac === newMAC);

if (existingEntry) {
    // MAC address already exists
    msg.mac_counter = count;
    msg.new_device = false;
} else {
    // New MAC address
    if (count >= MAX_MAC_ADDRESSES) {
        msg.mac_counter = count;
        msg.newdevice = false;
    } else {
        macAddresses.push({ mac: newMAC, type: type });
        count++;
        flow.set('mac_addresses_114', macAddresses);
        flow.set('mac_count_114', count);
        msg.mac_counter = count;
        msg.new_device = true;
    }
}
return msg;

/**
 * Node-RED function to populate msg.options with an array of stored MAC addresses.
 * Retrieves MAC addresses from a single flow storage key ('macAddresses').
 * 
 * @param {Object} msg - Node-RED message object with mac_counter property
 * @returns {Object} msg - Updated message with options array containing MAC addresses
 */

// Retrieve MAC addresses from flow storage
const macAddresses = flow.get('mac_addresses_114') || [];

// Ensure mac_counter is valid and does not exceed stored array length
const count = Math.min(Math.max(0, msg.mac_counter || 0), macAddresses.length);

// Populate options array with just the MAC addresses
msg.options = macAddresses.slice(0, count).map(entry => entry.mac);
return msg;

let base_path_ = flow.get("base_path_114") || null;
let filename = base_path_;

let type = msg.payload.sensor_data.sensor_type;
let addr = msg.payload.sensor_data.addr;
let date = msg.date;
let base_path = filename;

msg.filename = base_path + type + "/" + addr + "/" + date + ".csv";
msg.temp = msg.payload.sensor_data;
msg.payload = msg.payload.sensor_data;

return msg;

const min_time = msg.min_time;
const max_time = msg.max_time;
let array = msg.payload;

if(min_time && max_time){
    // Check if msg.payload exists and is an array.
    if (Array.isArray(msg.payload)) {
        // Use the .filter() method to create a new array containing only the items
        // that satisfy the condition.
        msg.payload = msg.payload.filter(item => {
            if(item.col5 == 111){
                // Check if the 'received' property exists and is a number.
                // This prevents errors if the property is missing or has an unexpected type.
                if (typeof item.col57 === 'number') {
                    // Check if the 'received' timestamp is within the defined range (inclusive).
                    return item.col57 >= min_time && item.col57 <= max_time;
                } else {
                    // Log a warning if 'received' property is missing or not a number.
                    // These items will be excluded from the filtered array.
                    node.warn(`Item skipped: 'received' property missing or not a number in object`);
                    return false; // Exclude this item from the filtered array
                }
            } else { 
                // Check if the 'received' property exists and is a number.
                // This prevents errors if the property is missing or has an unexpected type.
                if (typeof item.col33 === 'number') {
                    // Check if the 'received' timestamp is within the defined range (inclusive).
                    return item.col33 >= min_time && item.col33 <= max_time;
                } else {
                    // Log a warning if 'received' property is missing or not a number.
                    // These items will be excluded from the filtered array.
                    node.warn(`Item skipped: 'received' property missing or not a number in object`);
                    return false; // Exclude this item from the filtered array
                }
            }
        });
        array = msg.payload;
    } else {
        // If msg.payload is not an array, log a warning and return the original message.
        node.warn("msg.payload is not an array or is missing. No filtering performed.");
    }
} else {
    msg.payload = msg.payload.slice(-20);
}

let msg2 = {}
msg2.payload = array[array.length - 1];
if(!msg2.payload){
    msg2.payload = {
        'col33' : '--',
        'col2' : '--',
        'col6' : '--',
        'col32' : '--',
